[{'comment_id': 446504854, 'comment_body': 'Should we add event_type for each property of Realm?', 'comment_created': datetime.datetime(2020, 6, 27, 9, 15, 45, tzinfo=datetime.timezone.utc), 'commenter': 'arpit551', 'type': 'User'}, {'comment_id': 446689386, 'comment_body': "Yeah, this is the right approach to use for anything from `support`.  I'd prefer to pass this as kwargs BTW, `acting_user=request.user`.", 'comment_created': datetime.datetime(2020, 6, 28, 19, 36, 26, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446689524, 'comment_body': "Same comment on passing by kwargs; I'd even consider making these functions defined as:
```
def do_change_logo_source(realm: Realm, logo_source: str, night: bool, *, acting_user: UserProfile) -> None:
```

(note the `*`), so that one is required to pass the argument as a kwarg.", 'comment_created': datetime.datetime(2020, 6, 28, 19, 37, 39, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446689770, 'comment_body': "I think you're missing a callpoint in `zproject/backends.py`; that one I'd prefer to have explicitly pass `acting_user=None`.  The goal here is to have code be explicit about how the acting user is, even if it's unknown (as in the case where a synchronization tool is making the change).", 'comment_created': datetime.datetime(2020, 6, 28, 19, 40, 15, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446689905, 'comment_body': "I suspect you don't need `user_registered_itself`; is there a case where it should not be implied by `acting_user=None`?", 'comment_created': datetime.datetime(2020, 6, 28, 19, 41, 29, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446690183, 'comment_body': "Let's call this `REALM_PROPERTY_CHANGED`", 'comment_created': datetime.datetime(2020, 6, 28, 19, 45, 2, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446690341, 'comment_body': "@mateuszmandera what are your thoughts on this?  I think it's probably simplest to just have a single `event_type`; if we feel the need to have an index on the property, we can always make that happen by adding a new column extracted from `extra_data`; I suppose the question is whether we want to do that now.  

Overall realm property changes will be rare so I don't think it much matters; scanning all the Realm property changes for a realm should be super fast as it's unlikely to ever be more than 100 events per realm.", 'comment_created': datetime.datetime(2020, 6, 28, 19, 46, 24, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446695522, 'comment_body': "@timabbott  I think we do want to have acting_user to be the modified_user itself here( In the cases where the user registered itself) Couldn't found a way how we can do that by not passing the user_registered_itself argument since we can't pass the user_profile.", 'comment_created': datetime.datetime(2020, 6, 28, 20, 39, 3, tzinfo=datetime.timezone.utc), 'commenter': 'arpit551', 'type': 'User'}, {'comment_id': 446696848, 'comment_body': '@timabbott Should we use this style in every function that records RealmAuditLog?', 'comment_created': datetime.datetime(2020, 6, 28, 20, 52, 34, tzinfo=datetime.timezone.utc), 'commenter': 'arpit551', 'type': 'User'}, {'comment_id': 446699399, 'comment_body': '@timabbott What about the test cases( where these functions are used) should we pass none there explicitly too? I suppose if we want to pass this as kwargs then we have to specify it mandatorily.', 'comment_created': datetime.datetime(2020, 6, 28, 21, 18, 57, tzinfo=datetime.timezone.utc), 'commenter': 'arpit551', 'type': 'User'}, {'comment_id': 446704772, 'comment_body': 'Oh, my suggestion was `acting_user=None` could be the conditional for "mark this user as self-created", without a separate flag needed.  I think that `acting_user=None` will be what we pass for that parameter exactly in the cases where we'd pass `user_registered_itself`.', 'comment_created': datetime.datetime(2020, 6, 28, 22, 14, 29, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446704883, 'comment_body': "At least of the ones in `actions.py` that call `send_event`, yeah.  (No need to migrate the existing ones in this PR, but we'll want to do that eventually).", 'comment_created': datetime.datetime(2020, 6, 28, 22, 15, 9, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 446749666, 'comment_body': "@timabbott Okay just that we pass none for management commands and in backend.py. So won't we have to differentiate this with them?", 'comment_created': datetime.datetime(2020, 6, 29, 3, 14, 17, tzinfo=datetime.timezone.utc), 'commenter': 'arpit551', 'type': 'User'}, {'comment_id': 450549986, 'comment_body': "I fixed this, but FYI the text here didn't match the `actions.py` version and had some typos.", 'comment_created': datetime.datetime(2020, 7, 7, 0, 41, 44, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 450550305, 'comment_body': 'I'm pretty sure the `old_value` here is fetched too late.

I think this logic is also going to end up logging "changes" even when a field's value wasn't changed in this request.', 'comment_created': datetime.datetime(2020, 7, 7, 0, 42, 59, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 453373759, 'comment_body': 'Usually, before calling these functions we check that the previous value should not be the same as the updated value still if want we can do a check here and do an early return.', 'comment_created': datetime.datetime(2020, 7, 12, 23, 0, 29, tzinfo=datetime.timezone.utc), 'commenter': 'arpit551', 'type': 'User'}, {'comment_id': 460240591, 'comment_body': 'I tweaked this to only log values that actually changed from the appropriate `old_values` entry.', 'comment_created': datetime.datetime(2020, 7, 24, 19, 14, 2, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 460241148, 'comment_body': 'I removed `in_home_view` and added an assertion that `old_value` actually changed from the previous value in this test.', 'comment_created': datetime.datetime(2020, 7, 24, 19, 15, 13, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 460241580, 'comment_body': 'We want as a policy to always pass `acting_user`, so I changed that in these test call points.', 'comment_created': datetime.datetime(2020, 7, 24, 19, 16, 12, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 460414287, 'comment_body': "I'm very late to reply, but agreed, having so many new event types seems like a mess and doesn't seems like that much of an added benefit", 'comment_created': datetime.datetime(2020, 7, 25, 15, 15, tzinfo=datetime.timezone.utc), 'commenter': 'mateuszmandera', 'type': 'User'}, {'comment_id': 466763210, 'comment_body': 'Uh, JSON encoding this `Stream` object does not do what you think:

